    false,nt"url": null,nt"notes": "The goal of this plan is "to provide and
    protect a habitat base of sufficient quality and quantity to maintain healthy viable
    populations of waterbirds in the San Luis Valley." A total of 230,000 acres of
    wetlands of which 30,000 acres will be intensively managed should be sufficient
    to meet the plan goal. Issues and strategies for waterbird and wetland management
    are presented. Future development of intensively managed public areas should include
    water and landscape needs relating to this plan's objectives.",nt"license_title":
